INSERT INTO `data_concepts` VALUES (1,NULL,'BioRails',1,'This is the main <strong>context </strong>or<strong> conceptual name space </strong>for all key <strong>concepts </strong>in the core BioRails application. The context is divided into a logical tree of concepts.&nbsp; These concepts can be extended with child concepts providing&nbsp; the possibility of <strong>value lookup lists</strong> defined against each concept. In-use concepts<strong> </strong>are linked to <strong>parameter types </strong>at the global catalogue level. Parameter types are then implemented as <strong>study parameters</strong> and a linked lookup <strong>element </strong>may be used.<br />\r\n<br />\r\nThis structure provides a solid division of control between global warehousing need and local terminology, put more simply, the scientists can maintain their own (often unique) terminologies which can be mapped into the corporate dictionaries.',NULL,3,'sys','2007-01-22 15:23:29','sys','2007-01-23 20:54:17','DataContext'),(2,1,'Subject',1,'Subject',NULL,1,'sys','2006-09-06 19:33:33','sys','2006-09-06 19:33:33','DataConcept'),(3,1,'Study',1,'Study',NULL,1,'sys','2006-09-06 19:35:22','sys','2006-09-06 19:35:22','DataConcept'),(4,2,'Compound',1,'Compound Inventory',NULL,5,'sys','2006-09-06 19:35:33','sys','2006-10-09 16:01:50','DataConcept'),(5,2,'Batch',1,'Batch',NULL,1,'sys','2006-09-06 19:35:43','sys','2006-09-06 19:35:43','DataConcept'),(6,2,'Sample',1,'Sample',NULL,1,'sys','2006-09-06 19:35:50','sys','2006-09-06 19:35:51','DataConcept'),(7,2,'Container',1,'Container',NULL,2,'sys','2006-09-06 19:36:00','sys','2007-01-19 15:37:11','DataConcept'),(8,7,'Plate',1,'Plate',NULL,1,'sys','2006-09-06 19:36:07','sys','2006-09-06 19:36:07','DataConcept'),(9,7,'Rack',1,'Rack',NULL,1,'sys','2006-09-06 19:36:13','sys','2006-09-06 19:36:13','DataConcept'),(10,7,'Tube',1,'Tube',NULL,1,'sys','2006-09-06 19:36:24','sys','2006-09-06 19:36:24','DataConcept'),(11,7,'Tray',1,'Tray',NULL,2,'sys','2006-09-06 19:36:32','sys','2006-09-06 19:39:47','DataConcept'),(21,3,'Invivo',1,'Invivo',NULL,1,'sys','2006-10-10 12:00:03','sys','2006-10-10 12:00:03','DataConcept'),(22,3,'Invitro',1,'Invitro',NULL,2,'sys','2006-10-10 12:00:31','sys','2006-10-10 12:00:56','DataConcept'),(24,1,'Experiment',1,'Experiment main element in the execution of a workflow',NULL,1,'sys','2006-11-22 12:49:19','sys','2006-12-05 18:15:43','DataConcept'),(25,1,'Protocol',1,'Protocol',NULL,0,'sys','2006-11-22 12:52:00','sys','2006-11-22 12:52:00','DataConcept'),(26,1,'Unit',1,'Unit',NULL,0,'sys','2006-11-22 12:52:30','sys','2006-11-22 12:52:30','DataConcept'),(27,1,'Task',1,'Task',NULL,0,'sys','2006-11-22 12:53:17','sys','2006-11-22 12:53:17','DataConcept'),(28,1,'DataType',1,'Various type of data the system is expected to handle like numeric ,text',NULL,3,'sys','2006-11-22 12:53:47','sys','2007-01-22 23:32:32','DataConcept'),(29,1,'DataFormat',1,'Data Formats are skill',NULL,1,'sys','2006-11-22 12:56:05','sys','2007-01-12 13:58:05','DataConcept'),(30,1,'ParameterType',1,'ParameterType',NULL,0,'sys','2006-11-22 12:56:57','sys','2006-11-22 12:56:57','DataConcept'),(31,1,'ParameterRole',1,'Parameter Role',NULL,0,'sys','2006-11-22 12:57:18','sys','2006-11-22 12:57:18','DataConcept'),(33,1,'Times',1,'Timed Measurements',NULL,0,'sys','2006-12-12 13:53:02','sys','2006-12-12 13:53:02','DataConcept'),(39,1,'Lookup',1,'Lookup',NULL,0,'sys','2007-01-19 16:04:03','sys','2007-01-19 16:04:03','DataConcept'),(47,39,'Mammals',0,'Mammals licensed by company for pre-clinical safety studies',NULL,2,'sys','2007-01-31 13:51:33','sys','2007-01-31 13:51:54','DataConcept');
